  \"Thermally Stable Catalytic Combustors for Very High Altitude Airbreathing Propulsion
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T21:04:44.429067\",\n\t\"name\":
  \"thermally-stable-catalytic-combustors-for-very-high-altitude-airbreathing-propulsion-proje\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Aerospace vehicles operating at high altitudes
  have the potential to be less expensive and more versatile alternatives to space
  based systems for earth/space science, communications, and surveillance.  However,
  the operational flexibility of these vehicles is limited by the performance of the
  propulsion system.  In gas turbine systems low temperatures and pressures at the
  combustor inlet are of concern for combustion stability and efficiency at high altitudes.
  \ The overall objective of the proposed work is to assess the feasibility of developing
  a high performance airbreathing combustor for hydrogen-fueled very high altitude
  aircraft by promoting stable combustion using thermally stable catalytic reactor
  technology.  Our combustor concept baselines the use of strontium-substituted hexaaluminate
  catalyst supports, which are resilient to temperatures greater than 1500 K.  In
  Phase I an active catalyst that provides high reactivity with hydrogen at representative
  conditions will be identified through laboratory testing.  An empirical model of
  catalyst reactivity will be developed and integrated with a reactor model to produce
  a conceptual design of a full scale combustor for a defined very high altitude gas
  turbine system.  The catalytic rector that will be developed through this effort
  represents a new, enabling technology that will dramatically increase the flexibility
  of aerospace vehicles.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
